import React from "react";
import { BrowserRouter, Routes, Route } from 'react-router-dom';

import AnimalPenguim from "../animais/AnimalPenguim";
import AnimalOnca from "../animais/AnimalOnca";
import AnimalArara from "../animais/AnimalArara";
import AnimalBaleia from "../animais/AnimalBaleia";

const Rotas = () => (
    <BrowserRouter>
        <Routes>
            <Route exact path="/penguim" element={<AnimalPenguim />} />
            <Route exact path="/onca" element={<AnimalOnca />} />
            <Route exact path="/arara" element={<AnimalArara />} />
            <Route exact path="/baleia" element={<AnimalBaleia />} />
        </Routes>
    </BrowserRouter>
);

export default Rotas;
